import React from "react";

const Topbar = (props) => {
    let goBack= <React.Fragment/>;
    let selectView= <React.Fragment/>;
    return props.enter ?
        (
        <React.Fragment>
            <button className="back" onClick= {()=>props.back()}> BACK </button>
            <select className="viewType">
                <option type="Day" > Day </option>
                <option type="Week" > Week </option>
                <option type="Month" > Month </option>
            </select>
        </React.Fragment>
        )
    :
        (
        <div className="header">
        {goBack}
            <div className="headerFont">
                <div className="oneLine">
                    <input
                        placeholder="ðŸ”Ž Search Teacher"
                        className="input"
                        type="text"
                        onChange={props.textChange}
                    />
                </div>
            </div>
        {selectView}
        </div>
    );
};

export default Topbar;
